import{_ as e,c as t,o as a,e as s}from"./app.c5917f2e.js";const o="/assets/dbd_project_instance.268ffdd6.png",g=JSON.parse('{"title":"Creating Project Instance","description":"","frontmatter":{},"headers":[],"relativePath":"discord-dashboard/v3/creating-project-instance.md","lastUpdated":1667930819000}'),r={name:"discord-dashboard/v3/creating-project-instance.md"},n=s('<h1 id="creating-project-instance" tabindex="-1">Creating Project Instance <a class="header-anchor" href="#creating-project-instance" aria-hidden="true">#</a></h1><p>Discord-Dashboard is a module that needs a permanent connection to your ACS (Assistants Center Services) account.</p><p><strong>Why?</strong></p><p>Because we care about your satisfaction, the module has several systems that need authorisation with our external system. These include, for example, your project statistics and the project licensing system.</p><ul><li>Statistics is a summary of your project activity that only you can access whenever you want. Statistics only work in production mode, so dev mode does not send statistics.</li><li>Project licensing is about to identify whether you have a Premium Plan to unlock specially developed modules, addons and much more! <a href="https://assistantscenter.com/discord-dashboard" target="_blank" rel="noreferrer">Learn more about Premium Plan.</a></li></ul><hr><p>To create your DBD v3 project instance, go to <a href="https://assistantscenter.com/discord-dashboard" target="_blank" rel="noreferrer">Discord-Dashboard v3 Project Instances Management Page</a> and click the &quot;Create New Project&quot; button.</p><p><img src="'+o+'" alt="Project Instance Management Page"></p>',8),c=[n];function i(d,p,l,h,u,m){return a(),t("div",null,c)}const f=e(r,[["render",i]]);export{g as __pageData,f as default};
